var __index = {"config":{"lang":["en"],"separator":"[\\s\\u200b\\-_,:!=\\[\\]()\"`/]+|\\.(?!\\d)|&[lg]t;|(?!\\b)(?=[A-Z][a-z])","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"My reloading book","text":"<p>This site is to write up more comprehensive notes and how to's for my future self throughout my journey in competition shooting. Consiting of a multitude of handy links, diagrams and experiences in reloading ammunition.</p> <p></p> <p>Forever improving, never complete.</p> <p>All content on this site is for educational purposes only.</p>"},{"location":"load-and-chronograph-data/ggg-175-factory.html","title":"GGG .308 Win 175gr FMJ Match HPBT","text":"Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) 2962.2 2974.8 2951.2 2950.4 2952.2 2958.1 24.4 9.3 0.54"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html","title":"Hand load 185gr Juggernaut","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#summary","title":"Summary","text":"<p>Initial load testing of 185gr Berger Juggernauts with VihtaVuori N150. Used VihtaVuori reloading data https://www.vihtavuori.com/reloading-data/rifle-reloading/?cartridge=30 to sample. </p> <p>This is a new powder for me, so testing low charge weights initially to see how it groups.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#_1","title":"Hand load 185gr Juggernaut","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#initial-load","title":"Initial Load","text":"Powder Primer Brass COAL (inch) CBTO (inch) Start Charge (gr) End Charge (gr) VihtaVuori N150 Magtech Small Rifle Lapua Palma SR (LPT03781) 2.8430 2.1765 37.5 41 <p>Special notes: The COAL below is greater than VihtaVuori's load data of 2.795\". Max charge from VihtaVuori data is 40.6gr, but I tested to 41gr.</p> <p>There were no pressure signs observed, and there is still plenty of case capacity. More testing is needed since velocity is not where I'd like (looking for ~2750fps or greater).</p> <p>Testing performed at 200 yards with 0 minutes of windage.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#estimates-of-initial-charges-using-gordons-reloading-tool","title":"Estimates of initial charges using Gordons Reloading Tool","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#initial-charges-actual-results","title":"Initial charges - actual results","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#raw-data","title":"Raw data","text":"Charge Weight (gr) Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) 37.5 2334.2 2329.1 2344.9 2319.5 2315.4 2328.6 29.5 11.8 0.95 37.8 2355.1 2357.4 2331.7 2337.8 2337.3 2343.9 25.7 11.6 0.24 38.1 2357.5 2380.9 2372.1 2358.8 2388.4 2371.5 30.9 13.5 0.33 38.4 2388.3 2384.7 2388.6 2378.7 2388.3 2385.7 9.9 4.2 0.68 38.7 2393.2 2409.7 2392.3 2404 2419.1 2403.7 26.8 11.3 0.53 39 2416.1 2437.2 2433.7 2423.9 2449.7 2432.1 33.6 12.9 0.31 39.3 2439.3 2436.2 2428.7 2429.9 2449.2 2436.7 20.5 8.3 0.69 39.6 2441.7 2457.4 2461.7 2469.4 2448.3 2455.7 27.7 10.9 0.92 40 2472 2484.8 2491.1 2484.2 2468.6 2480.1 22.5 9.5 0.72 40.3 2499.4 2509.8 2505.9 2508.4 2499.6 2504.6 10.4 4.9 0.67 40.6 2531.4 2525.5 2513.5 2538.9 2534.6 2528.8 25.4 9.8 0.59 40.8 2531.7 2534.6 2531.1 2540.7 2536.1 2534.8 9.6 3.9 0.46 41 2529.2 2563.2 2550.5 2550.1 2554.2 2549.4 34.0 12.5 0.54 <p>Initial load testing grouped well, with some low SD/ES numbers in places. Comparing to Gordons Reloading Tool, real numbers appear to be ~30fps slower on average. Velocity is not high enough for me to be happy at 1000 yards, so will next perform a single shot ladder test to determine velocity nodes and max pressure.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#berger-example-ballistics-data","title":"Berger example ballistics data","text":"Bullet Diameter 0.308 inches Zero Range 100 yards Bullet Weight 185 grains Sight Height 1.50 in Ballistic Coefficient 0.284 Muzzle Velocity 2750 fps Temperature 59 F Wind Speed 0.00 mph Altitude 0 feet Wind Direction 9 o'clock Inclination 0 degrees Berger Bullets Copyright 2013 Range (y) Velocity (fps) Energy (ft-lbs) Elevation (moa) Windage (moa) TOF (s) 100 2588 2752 -0.00 0.00 0.11 200 2432 2430 -1.76 0.00 0.23 300 2281 2138 -4.22 0.00 0.36 400 2136 1874 -7.05 0.00 0.49 500 1996 1637 -10.21 0.00 0.64 600 1861 1423 -13.70 0.00 0.79 700 1730 1230 -17.57 0.00 0.96 800 1604 1057 -21.85 0.00 1.14 900 1482 902 -26.62 0.00 1.33 1000 1365 765 -31.95 0.00 1.54 <p>Goal is for projectile to be above transonic speeds (1340-890fps) at 1000 yards for the best chance of a good group.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#estimates-of-ladder-charges-using-gordons-reloading-tool","title":"Estimates of ladder charges using Gordons Reloading Tool","text":"<p>The estimates below will sill not yield the FPS I am looking for. We'll likely be lower than this with the chronograph based on our average of 30fps less from initial testing.</p> <p></p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#ladder-testing-actual-results","title":"Ladder testing - actual results","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#ladder-testing-raw-data","title":"Ladder testing - raw data","text":"<p>The VihtaVuori load data appears to be quite conservative maxing out at 40.6 which averages 2530fps. This doesn't yield enough velocity for FTR shooting for me to be comfortable. I decided to seat the bullet longer (ogive 0.005\" off the lands) which allows for much more case fill.</p> <p>I ran all the way up to 44.4gr excepting to see pressure signs before then. There was a small amount of room left in the case - I do not want to compress loads. </p> <p>No pressure signs were observed throughout all the testing, surprisingly. Ambient temperature was ~28\u00b0C with two minutes of pause left between each round.</p> Charge Weight (gr) Velocity (FPS) 37.5 2395.2 37.8 2375.2 38.1 2426.4 38.4 2461.5 38.7 2444.5 39.0 2499.6 39.3 2516.3 39.6 2520.3 39.9 2538.7 40.2 2544.6 40.5 2550.4 40.8 2568.0 41.1 2584.3 41.4 2580.6 41.7 2590.2 42.0 2619.3 42.3 2615.1 42.6 2634.8 42.9 2645.9 43.2 2688.1 43.5 2691.7 43.8 2707.0 44.1 2723.0 44.4 2741.2 <p>All shots were aimed at dead centre with no modifications or allowances made to elevation or windage throughout.</p> <p></p> <p>Showing cases after firing. No pressure signs were observed throughout this test. Cases and primers look same all the way through from lowest to highest charge.</p> <p></p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#final-charges-actual-results","title":"Final charges - actual results","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#10-shot-tests-raw-data","title":"10 shot tests - raw data","text":"<p>During this range trip, I loaded 10 rounds of 44.1gr, 44.4gr, 44.6gr and 44.8gr. No pressure signs were observed again. These strings were shot at 200 yards again. All shots were aimed dead centre target, with no allowances made for wind. This trip had wind gusts of up to 20mph.</p> Charge Weight (gr) Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Shot 6 Shot 7 Shot 8 Shot 9 Shot 10 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) 44.1 2725.6 2716.1 2725.4 2713.9 2721.2 2713.2 2718.6 2717.3 2716.6 2715.8 2718.4 12.4 4.4 0.62 44.4 2733.9 2733.3 2739.2 2738.5 2740.6 2736.7 2737.6 2733.8 2740.6 2733.8 2736.8 7.3 2.9 0.62 44.6 2745 2751.2 2755.4 2754.6 2757.8 2749.2 2747.4 2746.3 2753.6 2746.1 2750.7 12.8 4.5 0.59 44.8 2766.3 2768.2 2776 2758.7 2780.5 2765.3 2754.9 2776 2783.1 2781.7 2771.1 28.2 9.9 0.85 <p>44.1 grains. 0.62 MOA group. Unfortunately, I didn't grab a screenshot of this.</p> <p> 44.4 grains. 0.62 MOA group</p> <p> 44.6 grains. 0.59 MOA group</p> <p> 44.8 grains. 0.85 MOA group</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#max-pressure-testing","title":"Max Pressure testing","text":"<p>I wanted to see how much more velocity I could achieve here. I wasn't far off max case fill, so I pushed it till I saw pressure signs, without compressing the powder.</p> <p>I recently changed my bipod to a Seb Joypod-X, which gives me a much better, stable position. I wanted to discount some of the movement in my previous tests to poor positioning.</p> <p>As previous, these were aimed dead centre, and not making any allowance for wind.</p> Charge Weight (gr) Shot 1 Shot 2 Shot 3 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) 44.6 2757.3 2755.5 2748.4 2753.7 8.9 3.8 0.19 44.8 2770.4 2779 2753.3 2767.5 25.7 10.6 0.33 45 2782.2 2779.2 2778.7 2780 3.5 1.5 0.24 45.2 2797.5 2797.4 2792.3 2795.7 5.2 2.4 0.3 45.4 2800.1 2809.3 2810.7 2806.7 10.6 4.7 0.74 <p>I received a heavy bolt on 45.4 grains and it grouped terribly even in just these three shots.</p> <p>44.6 grains still looks like a good contender, but 45 grains also looks like it should receive some more testing with its group not being much more than 44.6, but also receiving a better SD and ES.</p> <p> 44.6 grains. 0.19 MOA group</p> <p> 44.8 grains. 0.33 MOA group</p> <p> 45 grains. 0.24 MOA group</p> <p> 45.2 grains. 0.3 MOA group</p> <p> 45.4 grains. 0.74 MOA group</p> <p>I'll load up 10-15 rounds of 44.6 and 45 grains to do a better assessment.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#match-results","title":"Match results","text":"<p>Using 44.6gr seems to be a really nice load for up to 600 yards. I won the FTR 300 yard match at the Imperial Meeting 2025:</p> <p></p> <p>Also club match out to 600 yards yielded a 50.6:  </p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#_2","title":"Hand load 185gr Juggernaut","text":""},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#once-fired-brass","title":"Once fired brass","text":"<p>Initial testing of once fired brass. Bumped back .002\" and still with a 2.2850\" CBTO.</p> <p>I did have a two flyers througout this testing, so I will need to go back and verify. Since there were only two flyers, I have decided to discount these since they were way off.</p> Charge Weight (gr) Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) (without flyers) Group (MOA) (with flyers) 43.8 2750.8 2738.1 2736.1 2735.3 2733.9 2738.8 16.9 6.9 0.19 0.41 44 2755.5 2746.3 2743.4 2742 2737.4 2744.9 18.1 6.7 0.4 0.4 44.2 2751 2761 2749.6 2749 2740.6 2750.2 20.4 7.3 0.32 0.32 44.4 2763.5 2759.4 2747.4 2767.1 2749.9 2757.5 19.7 8.5 0.13 0.43 44.6 2768.7 2771.4 2774 2764.4 2765 2768.7 9.6 4.1 0.52 0.52 <p>Unfortunately, these groups were shot at 300 yards, instead of 200 yards. Therefore, it is difficult to get an accurate representation on any improvements.</p> <p>Average velocity appears to have increased ~20fps between new and once fired brass. My previous \"winning\" load was 44.6gr, and this now appears to be 44.4gr, based on group size, if I discount the flyer on this test. My previous best group with 44.6 was 0.59 MOA at 200 yards (1.2357\"), and my new best so far is 0.13 MOA (0.4084\"). Initially, this appears to be a drastic improvement!</p> <p>No pressure signs were observed throughout this test.</p>"},{"location":"load-and-chronograph-data/handload-185-juggernaut.html#screenshots","title":"Screenshots","text":"<p>43.8gr showed promise, despite the flyer. Discounting this resulted in a sub quarter MOA group. Based on the vertical spread, I suspect the flyer to the left was the wind - keeping the same aim point at 300 yards will show this.  </p> <p>44gr was ok, nothing great. A bit more vertical spread than I'd like. </p> <p>44.2gr an ok group. Nothing fantastic, but nothing to complain about here. Reasonable amount of vertical though. </p> <p>44.4gr was another good group - I suspect the flyer was the wind based on the elevation being relatively consistent. Both groups shown with and without the flyer below.  </p> <p>44.6gr opened up a little on the vertical. Discounting shot 5, we'd be roughly quarter MOA. </p> <p>Based on this, the groups have definitely improved over new brass. Will need to repeat the tests again to get some extra validation. It would appear that my previous 44.4gr and 44.6gr charge weights can remain. I'd also like to work up to 45gr to see if the node continues.</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html","title":"Hand load 200.20X","text":""},{"location":"load-and-chronograph-data/handload-200-20x.html#summary","title":"Summary","text":"<p>Initial load testing of 200.20X Berger with VihtaVuori N150. Used VihtaVuori reloading data https://www.vihtavuori.com/reloading-data/rifle-reloading/?cartridge=30 to sample. </p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#initial-load","title":"Initial Load","text":"Powder Primer Brass COAL (inch) CBTO (inch) Start Charge (gr) End Charge (gr) VihtaVuori N150 Magtech Small Rifle Lapua Palma SR (LPT03781) 3.0550 2.2690 37.5 44.4 <p>Special notes: The COAL below is greater than VihtaVuori's load data of 2.795\". Max charge from VihtaVuori data is 40.3gr, but I tested to 44.4gr.</p> <p>There were no pressure signs observed, and there is still plenty of case capacity.</p> <p>Testing performed at 200 yards with 0 minutes of windage.</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#berger-example-ballistics-data","title":"Berger example ballistics data","text":"Bullet Diameter 0.308 inches Zero Range 100 yards Bullet Weight 200 grains Sight Height 1.50 in Ballistic Coefficient 0.328 Muzzle Velocity 2650 fps Temperature 59 F Wind Speed 0.00 mph Altitude 0 feet Wind Direction 9 o'clock Inclination 0 degrees Berger Bullets Copyright 2013 Range (y) Velocity (fps) Energy (ft-lbs) Elevation (moa) Windage (moa) TOF (s) 100 2513 2804 -0.00 0.00 0.12 200 2379 2514 -1.91 0.00 0.24 300 2250 2249 -4.50 0.00 0.37 400 2125 2006 -7.44 0.00 0.50 500 2004 1784 -10.67 0.00 0.65 600 1887 1581 -14.20 0.00 0.80 700 1773 1396 -18.06 0.00 0.97 800 1662 1227 -22.27 0.00 1.14 900 1554 1073 -26.88 0.00 1.33 1000 1450 934 -31.95 0.00 1.53 <p>Goal is for projectile to be above transonic speeds (1340-890fps) at 1000 yards for the best chance of a good group.</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#estimates-of-ladder-charges-using-gordons-reloading-tool","title":"Estimates of ladder charges using Gordons Reloading Tool","text":"<p>TBC</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#ladder-testing-raw-data","title":"Ladder testing - raw data","text":"<p>The VihtaVuori load data appears to be quite conservative maxing out at 40.6 which averages 2388fps. This doesn't yield enough velocity for FTR shooting. Initial ladder test was performed with a 2.2690\" CBTO. Will move out closer to the lands when I perform group testing.</p> <p>I ran all the way up to 44.4gr expecting to see pressure signs at around 43gr. </p> <p>No pressure signs were observed throughout all the testing, surprisingly. Ambient temperature was ~15\u00b0C with two minutes of pause left between each round.</p> Charge Weight (gr) Velocity (FPS) 37.5 2393.0 37.8 2403.7 38.1 2414.2 38.4 2427.8 38.7 2445.0 39.0 2458.1 39.3 2469.1 39.6 2478.4 39.9 2497.9 40.2 2507.8 40.5 2518.9 40.8 2531.1 41.1 2547.7 41.4 2555.0 41.7 2578.9 42.0 2589.7 42.3 2601.0 42.6 2614.0 42.9 2634.4 43.2 2645.9 43.5 2664.6 43.8 2667.1 44.1 2695.3 44.4 2711.9 <p>No pressure signs were observed throughout this test. Cases and primers look same all the way through from lowest to highest charge.</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#group-testing","title":"Group Testing","text":"<p>Not entirely happy with the results here. I was only able to shoot at 300 yards for this test, which differs from all other testing I've performed so far.</p> <p>43.2, 43.5 and 43.8 show promise with all being said. Ignoring windage, the vertical spread for each was ~0.5 MOA. These also had a reasonable SD/ES.</p> <p>Will need to load some more of these and test at 200 yards (to keep it the same as my other tests).</p> <p>Will also look at smaller charge increments to see if I can squeeze some more out.</p> <p>These were seated at 2.2690\" CBTO (0.020\" off the lands).</p> <p>This was only testing a single box of 100, so I'll buy a larger quantity since these look like they could shoot well.</p> <p>I'd definitely be looking to reach a 0.25 MOA grouping at 200 yards to be consistent with my 185gr rounds (these have proven to be a winner, since I have won some matches with these).</p>"},{"location":"load-and-chronograph-data/handload-200-20x.html#_1","title":"Hand load 200.20X","text":""},{"location":"load-and-chronograph-data/handload-200-20x.html#once-fired-brass","title":"Once fired brass","text":"<p>Nothing great about these groups. Best group was at 43.8, if we discount a flyer. Will need to experiment more with this load (seating depth and pointing). Having a 1:11 twist, and not full-bored for this head, I'm not sure how much better I'll get. Worst case, I'll keep these for when I get a new barrel.</p> <p>All of the shots had a half value head wind of around 7mph, so not ideal for testing group sizes. Overall, they're not terrible considering these all had the same point of aim. Need further testing on 33.8gr and 44.1gr to verify. Will also need to validate seating depth to see if the groups improve.</p> <p>No pressure signs were observed during this testing. Looks like the rounds sped up by around 20fps from new brass (same as the 185gr Juggernauts).</p> Charge Weight (gr) Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Average (FPS) Extreme Spread (FPS) Standard Deviation Group (MOA) without flyers Group (MOA) with flyers 42.9 2627.3 2632.1 2628.9 2642 2637.2 2633.5 14.7 6.1 0.73 0.73 43.2 2653.5 2655.6 2640.3 2650.7 2659.6 2651.9 19.3 7.3 0.52 0.52 43.5 2657.7 2653.9 2666.8 2671.3 2668.6 2663.7 17.4 7.5 0.53 0.53 43.8 2690 2686.4 2696.7 2687.5 2694.6 2691.0 10.3 4.5 0.24 0.68 44.1 2693.7 2696.5 2690.6 2682.4 2684.1 2689.5 14.1 6.1 0.75 0.75"},{"location":"load-and-chronograph-data/handload-200-20x.html#screenshots","title":"Screenshots","text":"<p>43.2gr had too much elevation. </p> <p>43.5gr had too much elevation. </p> <p>43.8gr had a good group, if we ignore the flyer to the right.  </p> <p>44.1gr had a good elevation spread if we ignore shot 4. Many things could have caused this flyer, so I can't ignore it. This is my first time resizing brass in my reloading journey, so there are a lot of variables that could affect this.</p> <p></p>"},{"location":"load-and-chronograph-data/hornady-155-a--max.html","title":"Hornady 155gr A-MAX Black","text":"Shot 1 Shot 2 Shot 3 Shot 4 Shot 5 Average (FPS) Extreme Spread (FPS) Standard Deviation 2962.2 2974.8 2951.2 2950.4 2952.2 2958.1 24.4 9.3"},{"location":"load-and-chronograph-data/measurements/lapua-palma.html","title":"Lapua Palma Brass (SRP)","text":""},{"location":"load-and-chronograph-data/measurements/lapua-palma.html#once-fired","title":"Once Fired","text":""},{"location":"load-and-chronograph-data/measurements/lapua-palma.html#fresh","title":"Fresh","text":"Item Value Case length 1.9985\" Shoulder (measured using Hornady Headspace Comparator) 1.6275\" Neck outer diameter 0.3425\""},{"location":"load-and-chronograph-data/measurements/lapua-palma.html#resized","title":"Resized","text":"Item Value Shoulder bumped (measured using Hornady Headspace Comparator) 0.0020\" Case length 2.005\" Neck outer diameter (using SAC .334 neck bushing) 0.3350\" Neck outer diameter after mandrel (using 21<sup>st</sup> Century .306 mandrel) 0.3355\""},{"location":"load-and-chronograph-data/measurements/Dolphin-FTR/185-juggernaut-oal.html","title":"Berger 185gr Juggernaut","text":"<p>Measurements for Dolphin FTR rifle using the Hornady Lock-N-Load\u00ae O.A.L. Gauge and modified case.</p> CBTO COAL 2.2915 2.9435 2.2905 2.9535 2.2925 2.9550 2.2915 2.9515 2.2925 2.9550 Average 2.2917 2.9517 <p>Rounding up the average CBTO to 2.9520. Will seat CBTO at 0.005 off the lands, 2.9470</p> <p>Verified bolt closes correctly with no movement to bullet through jam.</p> <p>Measuring using loctite method using once fired brass:</p> CBTO COAL 2.2900 2.9540"},{"location":"load-and-chronograph-data/measurements/Dolphin-FTR/200-20x-oal.html","title":"Berger 200.20X Hybrid Target","text":"<p>Measurements for Dolphin FTR rifle using the Hornady Lock-N-Load\u00ae O.A.L. Gauge and modified case.</p> CBTO COAL 2.2680 3.0540 2.2690 3.0550 2.2685 3.0545 2.2690 3.0550 Average 2.2687 3.0547 <p>Rounding up the average CBTO to 2.2690. Will seat CBTO at 0.020 off measured with the Hornady Lock-N-Load\u00ae O.A.L gauge, 2.2670, since this is the most conservative number. Will extend out during seating depth tests.</p> <p>Measuring using loctite method using once fired brass:</p> CBTO COAL 2.2755 3.0615 <p>Measuring using drop bolt method using new brass:</p> CBTO COAL 2.2710 3.0570"},{"location":"load-and-chronograph-data/measurements/Dolphin-FTR/ggg-175-factory.html","title":"GGG .308 Win 175gr FMJ Match HPBT","text":""},{"location":"rifles/anschutz-tr-rifle.html","title":"Anshutz 1913 Super Match Target Rifle","text":""},{"location":"rifles/dolphin-ftr-rifle.html","title":"Dolphin FTR Rifle","text":"<ul> <li>Nesika K single shot left handed action</li> <li>32\" Bartlein stainless steel barel 5R rifling</li> <li>1:11 twist</li> <li>Jewel Match trigger</li> <li>Nightforce Competition 15-55x52</li> <li>Seb Joypod-X bipod</li> <li>Dima RS rear bag</li> </ul>"}]}